Tripod Series::Sprinter Tripod Series<br>Bowl Diameter::100 mm (3.9 in)<br>Payload capacity::45 kg (99 lb)<br>Lock Type::Sprint-Loks<br>Maximum Height::1435 mm (56.5 in)<br>Minimum Height::670 mm (26.4 in)<br>Transport Length::850 mm (33.5 in)<br>Tube Type::Alloy<br>Construction::Single-Stage / 2-Section<br>Spiked/Rubber Legs:No/No<br>Weight::3.1 kg (6.8 lb)<br><br><br>・Sprinter II Single-Stage Alloy Tripod<br>・Easily accessible  high speed dual action locks<br>・Lightweight and rigid tripod construction<br>・Inline carry handle<br>・Forever-flat rubber foot design<br>・Rapid action transport clips<br><br><br>The Miller 1589 Sprinter II aluminum tripod features an industry-standard 100mm leveling half-bowl which accepts most fluid heads  and the aluminum legs are light while offering an economical alternative to the more expensive carbon fiber. This model is meant for run-and-gun ENG work where rapid setup and leveling are as necessary as rigidity and accuracy. <br><br><br><br></DIV>
