Size:150 mm / 5.91 inch<br>Weight:3.3 lbs / 1.50 kg<br><br><br>The Matthews CBC 150 mm Adaptor is an Elemac dolly mount to 150 mm bowl. The bowl accepts the ball of the fluid head. It sits on top of the Elemac mount on the top of the Bazooka (similar to a 1-riser stand w/o legs) or it can be mounted directly to an Elemac to Elemac Adapter.<br><br></DIV>
