Material:Aluminum<br>Head Type:3-way pan head<br>Quick Release:Yes<br>Camera Mount Thread Size:1/4''-20<br>Leg Sections:3<br>Leg Lock Type:Clamp<br>Independent Leg Spread:No<br>Tripod Feet:Rubber/Swivel<br>Center Brace:Yes<br>Center Column Type:Geared<br>Center Column Sections:1<br>Bubble Level:Yes<br>Maximum Height:53.1'' / 135 cm<br>Minimum Height:20'' / 51 cm<br>Folded Length:20'' / 51 cm<br>Load Capacity:6.6 lb / 3 kg<br>Weight:2.4lb / 1.1kg<br><br><br>・The Primax 150 comes with a compact and stable 3-way pan head with a Quick Release<br>・The tripod is constructed of anodized black aluminum for strength while maintaining a low weight of only 2.4 lb (1.1 kg)  making it ideal for travel<br>・A built-in bubble level helps the photographer to achieve precise camera positioning<br>・The Primax 150 will support equipment weighing up to 6.6 lb (3 kg) so it can be used with most compact  bridge and DSLR cameras<br><br><br>The Cullmann Primax 150 Aluminum Tripod has a 3-way-pan head with a quick release plate  a geared center column  clamp-type leg locks  swivel rubber feet and a bubble level for precise camera adjustments. It features sturdy  high-quality aluminum construction with three leg sections with clamp-type leg locks and a center brace that will support equipment weighing up to 6.6 lb (3 kg).<br><br>The Primax 150 will extend to a maximum height of 53.1'' (135 cm)  folds down to 20'' (51 cm)  weighs only 2.4 lb (1.1 kg) and it comes with a tripod bag which makes it a great tripod for travel. This tripod is perfect for both novices and advanced photographers using compact  bridge and DSLR cameras.<br><br></DIV>
