Tube Material:Aluminum Alloy<br>Folded Height (mm / inches):535 / 21-1/8<br>Extended Height (mm / inches):1450 / 57-1/8<br>Panhead:SBH-50<br>Quick Shoe:QS-39<br>Diameter of Leg (mm):23<br>Number of Sections:4<br>Rubber Feet:Yes<br>Max.Loading (kg / lbs):3.0 / 6.6<br>Weight (kg / lbs):1.50 / 3.30<br>Warranty:Vanguard limited lifetime warranty<br><br><br>・Dual locking safety mechanisms<br>・Clip locks<br>・Capable of low angle photography<br><br><br>The Vanguard Alta+ aluminum alloy tripod is from Vanguard's new competitive line of high end entry level tripod. Designed to meet the requirements of the most demanding photographer  the Alta+ aluminum alloy tripod offers a magnesium alloy canopy and head. The legs can all be adjusted individually to 3 different angles (25° 50° 80°) for uneven terrain and low angle shooting. <br><br>The dual locking safety mechanism and anti-shock ring prevent the damage that can be caused by camera vibration and will eliminate any worries you might have about your equipment falling from the tripod during transportation. The ergonomic handle  easy to lock panhead and splicing handle for carrying are just a few of the additional features offered by this tripod.<br><br></DIV>
