Screw thread Size:1/4''<br>Compatible with:Lamps featuring a 1/4'' screw thread<br><br><br>The Cullmann CU41033 comes complete with a removable ball and socket head with 1/4'' screw thread making it very easy to convert to a window or bonnet-mounted rifle. A quick loosen of the head's locking screw enables you to smoothly pan left and right through 360 degrees should you require it. The 41033 Suction Cup can be used as a lamp mount for the increasing number of high-powered lamps featuring a 1/4'' screw thread in them<br><br></DIV>
