Mounting Thread:3/8''-16<br><br><br>・Mounts to any device with a 3/8''-16 thread<br>・Arca-Swiss compatible<br><br><br>The Jobu Design Arca-Swiss Adapter (3/8''-16) will mount to any device that accepts a 3/8''-16 female threads and convert it into an Arca-Swiss-compatible device. You can mount it to a ball head for quick installation into a gimbal head  or mount it to the bottom of a gimbal head to drop into a ball head or leveling head.</DIV>
