Leveling Bubble/Illuminated:Yes / Yes<br>Counter Balance System:Continuously Variable Counterbalance<br>Quick Release/Wedge Plate:Yes<br>Balance Plate:Yes<br>Tilt Drag:Continuously Variable Fluid Drag<br>Tilt Range:±90°<br>Tilt Lock:Disk Brake<br>Pan Drag:Continuously Variable Fluid Drag<br>Pan Range:360°<br>Pan Lock:Disk Brake<br>Material:Aluminum and Magnesium alloys<br>Head Attachment Fitting:100mm<br>Leg Stages/Sections:2/3<br>Leg Lock Type:Smart Stop Technology<br>Independent Leg Spread:Yes<br>Spiked/Retractable Feet:Spiked<br>Center Brace:Mid-level<br>Load Capacity:22 lbs (10kg)<br>Maximum Height:62.6'' (141cm)<br>Minimum Height:33.3'' 75cm<br>Folded Length:38.6'' (87cm)<br>Weight:13.4 lbs (5.9kg)<br><br><br>・<b>Continuously Adjustable Counterbalance System: </b> The Laser features an infinitely variable counterbalance with easily readable numeric reference providing excellent performances at any tilt angle from -90 to +90 degrees.<br>・<b>Pan and Tilt Control: </b> The Laser offers a patented fluid damping system ensuring consistent drag levels and smooth camera movements throughout the range and allows continuous adjustments in both pan and tilt modes.<br>・<b>Smart Stop: </b> SmartStop features an innovative clamping system which allows instant release on both stages with one single lever per leg conveniently located on the upper part of the tripod for fast & secure use<br>・<b>Feet: </b> The bottom foot includes a threaded spike receiving an adjustable rubber foot (not included) and interfaces with dollies and ground spreaders<br><br><br>The Cartoni Z112 tripod system is the ideal solution for supporting DV camera payloads up to 22 lbs (10kg) when portability is paramount. The convenient and highly functional soft carrying case makes the system easy to transport on even the longest OB shoots  including the very accurate Laser fluid head. Combined with the L506 ultra light 2-stage tripod and a mid-level spreader for quick and easy setup and break down  the FZ112 is a sleek performer for all your mobile DV needs.</DIV>
