Compatibility:Gitzo series 3 tripod and tripods with leg diameters from 1.25''- 1.4'' (31.5mm-35.5mm)<br>Material:Neoprene<br>Length:12'' (30.48cm)<br>Closure:Velcro<br><br><br>LensCoat LegCoat 312 Wraps (Yellow) is made from soft neoprene to wrap around the upper leg of your tripod and is easily affixed with a Velcro closure. The Wraps backing is designed to tightly grip to your tripod legs so they will not slide.<br><br>The LegCoat Wraps act as a thermal barrier making the tripod more comfortable to handle in hot or cold conditions. The spongy soft neoprene acts as a cushion when carrying the tripod against your body without the bulk of the traditional LegCoat with extra foam padding. The Wraps also protect your tripod from nicks and scrapes and the camouflage patterns help break up it shape.<br><br>LegCoat Wrap 312 is designed for Gitzo series 3 tripod and tripods with leg diameters from 1.25''- 1.4'' (31.5mm-35.5mm) and are 12'' (30.48cm) in length.</DIV>
